import { createRouter, createWebHistory } from 'vue-router'

//==> importacoes das paginas

import HomeView from '@/views/pages/home/HomeView'
import LoginView from '@/views/pages/login/LoginView'


const routes = [
  {
    path: '/',
    name: 'login',
    component: ()=> import("@/views/pages/register/RegisterView")
  },
  {
    path: '/login',
    name: 'home',
    component: ()=> import("@/views/pages/register/RegisterView")
  },
  {
    path: '/register',
    name: 'register',
    component: ()=> import("@/views/pages/register/RegisterView")
  }
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
